import React, { Fragment, useState, useCallback } from "react";
import PropTypes from "prop-types";

const type_opcen = props => {
  return (
    <Fragment>
      <div style={{ display: "flex", flexDirection: "row" }}>
        <div> Government</div>
        <div> Volunteer</div>
        <div> Private </div>
      </div>
    </Fragment>
  );
};

type_opcen.propTypes = {};

export default type_opcen;
